    return (
      <div className="conatiner">
        <div className="input-name">
          <input type="text"
          placeholder = 'Create Timer'
          maxLength = '20'
          value = {this.state.timerName}
          onChange={props.onChange}
          />
          <button
          onClick = {this.props.onSubmit}
          >Add Timer</button>
        </div>
      </div>

    );
  }
}


export default TimerForm;
